import React from 'react';
import { NavLink } from 'react-router-dom';
import { useSelector } from 'react-redux';
import './ProjectsHolder.css'

function ProjectsHolder({ isLoaded }) {


    return (
        <div className='pHolder'>
            <h2>- Project Gallery</h2>
            <div className='pjs'>
                <div className='Large'>
                    <img src='https://img.icons8.com/ios-filled/344/github.png' alt='projects' className='pImg'></img>
                    <h3>Medium Clone</h3>

                </div>
                <div className='SoundTube'>
                    <img src='https://img.icons8.com/ios-filled/344/github.png' alt='projects' className='pImg'></img>
                    <h3>Audio Player Application</h3>

                </div>
                <div className='EmailVerify'>
                    <img src='https://img.icons8.com/ios-filled/344/github.png' alt='projects' className='pImg'></img>
                    <h3>Email Verification</h3>

                </div>
                <div className='EmailVerify'>
                    <img src='https://img.icons8.com/ios-filled/344/github.png' alt='projects' className='pImg'></img>
                    <h3>Tic-Tac-Toe Bot</h3>

                </div>
            </div>
        </div>
    );
}

export default ProjectsHolder;
